import React, { useState } from "react";

export function City(data) {

    const dataCity = data.title;
    
    let [city, setCity] = useState("Desconhecido!")
    
    function getCity() {
        setTimeout(
            setCity(city = dataCity), 
        8000);
    }

    window.addEventListener("load", getCity)

    return(
    <div>
        <p>{city}</p>
    </div>
    );
}
